import style from "./Navigation.module.css";
function Navigation(props) {
  return (
    <ul className={style.list}>
      {props.displayHandler && <li>Users</li>}
      <li>Admin</li>
      <li className={style.btn}>Logout</li>
    </ul>
  );
}
export default Navigation;
